import { Card, Col } from "antd";

function CarsCard({ cars }) {
    return (
        <Col>
      <Card
        title={food.name}
        style={{ width: 230, height: 300, margin: 10 }}
      >
                <p>{cars.BRAND}</p>
                <p>{cars.MODEL}</p>
                <p>{cars.DEALER}</p>
                <p>{cars.MIN_MILEAGE}</p>
                <p>{cars.MAX_MILEAGE}</p>
            </Card>
        </Col>
    )
}

export default CarsCard;
